import React from 'react';
import MainLayout from '../mainlayout';

const CalorieIndex: React.FC = () => {
  return (
    <MainLayout>
    <div>
      <h1>Calorie Index Page</h1>
      <p>Welcome to the Calorie Index page.</p>
    </div>
    </MainLayout>
  );
};

export default CalorieIndex;
